import base64
import os
import sys

sys.path.append(os.path.abspath("../"))

from unittest import TestCase
from unittest.mock import patch

from insightconnect_plugin_runtime.exceptions import PluginException
from komand_paloalto_wildfire.actions.submit_file import SubmitFile
from komand_paloalto_wildfire.actions.submit_file.schema import Input, Output

from test_util import Util


class TestSubmitFile(TestCase):
    @classmethod
    def setUpClass(cls) -> None:
        cls.action = Util.default_connector(SubmitFile())

    @patch(
        "pyldfire.WildFire.submit_file",
        side_effect=Util.mocked_requests_submit,
    )
    @patch("pyldfire.WildFire.get_verdicts", side_effect=Util.mocked_get_verdict)
    def test_submit_file_which_already_in_db(self, mock_submit_file, mock_get_verdicts) -> None:
        actual = self.action.run(
            {
                Input.FILE: base64.b64encode(str.encode("test_malvare")),
                Input.FILENAME: "EICAR.pdf",
            }
        )
        expected = {Output.VERDICT: "Malware"}
        self.assertEqual(actual, expected)

    @patch(
        "pyldfire.WildFire.submit_file",
        side_effect=Util.mocked_requests_submit,
    )
    @patch("pyldfire.WildFire.get_verdicts", side_effect=Util.mocked_get_verdict)
    def test_submit_file(self, mock_submit_file, mock_get_verdicts) -> None:
        actual = self.action.run(
            {
                Input.FILE: "",
                Input.FILENAME: "EICAR.pdf",
            }
        )
        expected = {
            Output.SUBMISSION: {
                "filetype": "PE32 executable",
                "filename": "EICAR.pdf",
                "sha256": "90c943721c01975d0c7b7fda18bf0f7568cc27bd224e06d65cce81ce7cbd15ca",
                "md5": "0b4d7fcf5d7d7b7b18fe445631308b12",
                "size": "55296",
                "supported_file_type": True,
            }
        }
        self.assertEqual(actual, expected)

    def test_unsupported_file_type(self) -> None:
        with self.assertRaises(PluginException) as context:
            self.action.run(
                {
                    Input.FILE: base64.b64encode(str.encode("test_file")),
                    Input.FILENAME: "EICAR.txt",
                }
            )

        self.assertEqual("Unsupported file was received by the plugin.", context.exception.cause)
        self.assertEqual(
            "Check if your file is one of the supported files and resubmit with an approved file type. Supported files: ('.apk', '.flash', '.jar', '.msi', '.dmg', '.pkg', '.doc', '.iqy', '.7z', '.slk', '.dll', '.dng', '.fon', '.lnk', '.ooxml', '.pkg', '.ps1', '.vbs', '.bat', '.docx', '.elf', '.hta', '.js', '.mach-o', '.pdf', '.pe', '.ppt', '.pptx', '.rar', '.rtf', '.xls', '.xlsx')",
            context.exception.assistance,
        )
